import logo from './logo.svg';
import './App.css';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Hauptseite from './pages/Hauptseite';
import Navbar from './components/navbar';
import Booknow from './components/booknow';
import Footer from './components/footer';
import Slideshow from './slideshow';

function App() {

  const images = [
    {imagePath:"https://sonnenhus.com/sonnenhusgross.jpg"},
    {imagePath:"http://getwallpapers.com/wallpaper/full/b/8/f/282452.jpg"},
    {imagePath:"https://tsnim.com/wp-content/uploads/2024/01/4K-Beautiful-Desktop-Wallpaper-Colorful-Nature-Sunset-Landscape-Free-Download-2048x1152.jpg"}
  ];

  return (
    <div className="App">
      <header>
        <Navbar/>
      </header>
      <div style={{padding:"10px"}}><Slideshow images={images} /></div>
      <div>
        <Hauptseite/>
        <Booknow/>
    </div>
    <footer>
      <Footer/>
    </footer>
    </div>
  );
}

export default App;
